            public void SubstringAsk(string payload, out decimal price, out decimal volume)
            {
                int positionStart, length;

                string startChars = "[[";
                string endChars = "],";

                positionStart = payload.AsSpan().IndexOf(startChars) + 2;
                length = payload.AsSpan().IndexOf(endChars) - positionStart;
                string ask = payload.Substring(positionStart, length);

                decimal.TryParse(ask.Substring(0, ask.IndexOf(endChars[1])), out price);
                decimal.TryParse(ask.Substring(ask.IndexOf(endChars[1]) + 1), out volume);
            }

            public void SubstringBid(string payload, out decimal priceBid, out decimal volumeBid)
            {
                string startBids = "[[";
                string endBids = "],";

                int startPosition = payload.LastIndexOf(startBids) + 2;
                int endPosition = startPosition + payload.AsSpan().Slice(startPosition).IndexOf(endBids[0]);
                int length = endPosition - startPosition;

                string bid = payload.Substring(startPosition, length);

                decimal.TryParse(bid.Split(',')[0], out priceBid);
                decimal.TryParse(bid.Split(',')[1], out volumeBid);
            }

