                int startPosition = payload.AsSpan().LastIndexOf(startBids) + 2;
                int endPosition = startPosition + payload.AsSpan().Slice(startPosition).IndexOf(endBids[0]);
                int length = endPosition - startPosition;

                ReadOnlySpan<char> bid = payload.AsSpan().Slice(startPosition, length);

                decimal.TryParse(bid.Slice(0, bid.IndexOf(endBids[1])), out priceBid);
                decimal.TryParse(bid.Slice(bid.IndexOf(endBids[1]) + 1), out volumeBid);
            }

            public void SliceAsk(string payload, out decimal price, out decimal volume)
            {
                int positionStart, length;

                ReadOnlySpan<char> startChars = new ReadOnlySpan<char>(new char[] { '[', '[' });
                ReadOnlySpan<char> endChars = new ReadOnlySpan<char>(new char[] { ']', ',' });

                positionStart = payload.AsSpan().IndexOf(startChars) + 2;
                length = payload.AsSpan().IndexOf(endChars) - positionStart;
                ReadOnlySpan<char> ask = payload.AsSpan().Slice(positionStart, length);

                decimal.TryParse(ask.Slice(0, ask.IndexOf(endChars[1])), out price);
                decimal.TryParse(ask.Slice(ask.IndexOf(endChars[1]) + 1), out volume);
            }
